import React from 'react'
import {Button} from '@material-ui/core'
 class Main extends React.Component{
    
     render(){
        const style ={
            backgroundColor: "#0a0a0a",
                color :"#b2f7eb",
                width: 250,
                border: "2px solid grey",
                padding: 5,
                margin: 3,
                display : "block",
                float: "left",
                fontFamily : "serif"
    }
   
        return (
            <div className ="Movie-names" style={style}>
                <img src={this.props.movie.imgUrl}width ="250" height="150" alt ="" />
                <h3>{this.props.movie.name}</h3>
                <p>Date :{this.props.movie.date} </p>
                <Button  color="primary" ><a href={this.props.movie.Trailer} target="_blank" rel ="noopener noreferrer">Watch Trailer</a></Button>

            </div>
        )
     }
 }
 export default Main
